 userReducer = (state = {
  name: 'Nandini',
  age: 24
}, action) => {
  switch (action.type) {
    case 'SET_NAME' :
      state = { ...state, name: action.payload }
      break
    case 'SET_AGE' :
      state = { ...state, age: action.payload }
  }
  return state
}
export default userReducer
